{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/sentiment-analysis-model-using-r?scriptVersionId=117993812\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"f743026d","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.00652,"end_time":"2023-02-02T05:57:29.303988","exception":false,"start_time":"2023-02-02T05:57:29.297468","status":"completed"},"tags":[]},"source":["# What is Sentiment Analysis?\n","- Sentiment analysis is the process of analyzing digital text to determine if the emotional tone of the message is positive, negative, or neutral. Today, companies have large volumes of text data like emails, customer support chat transcripts, social media comments, and reviews. Sentiment analysis tools can scan this text to automatically determine the author’s attitude towards a topic. Companies use the insights from sentiment analysis to improve customer service and increase brand reputation. \n","# Why is sentiment analysis important?\n"," - Provide objective insights\n"," - Build better products and services\n"," - Analyze at scale\n"," - Real-time results\n"," \n","# What are sentiment analysis use cases?\n","  - Improve customer service\n","  - Brand monitoring\n","  - Market research\n","  - Track campaign performance\n","  \n","# What are the different types of sentiment analysis?\n"," - Fine-grained scoring\n"," - Aspect-based\n"," - Intent-based\n"," - Emotional detection\n"," \n","\n","##### Reference : [Amazon](https://aws.amazon.com/what-is/sentiment-analysis/)\n","\n","\n","# Sentiment Analysis Model:\n","- We will carry out sentiment analysis with R in this project. The dataset that we will use will be provided by the R package ‘janeaustenR’.\n","\n","## janeaustenr: Jane Austen's Complete Novels:\n","- Full texts for Jane Austen's 6 completed novels, ready for text analysis. These novels are \"Sense and Sensibility\", \"Pride and Prejudice\", \"Mansfield Park\", \"Emma\", \"Northanger Abbey\", and \"Persuasion\". [janeaustenr](https://cran.r-project.org/web/packages/janeaustenr/index.html)\n","\n","\n","- In order to build our project on sentiment analysis, we will make use of the tidytext package that comprises sentiment lexicons that are present in the dataset of ‘sentiments’."]},{"cell_type":"markdown","id":"7b4ff91d","metadata":{"papermill":{"duration":0.005434,"end_time":"2023-02-02T05:57:29.316188","exception":false,"start_time":"2023-02-02T05:57:29.310754","status":"completed"},"tags":[]},"source":["# Install Libraries"]},{"cell_type":"code","execution_count":1,"id":"10d7378b","metadata":{"execution":{"iopub.execute_input":"2023-02-02T05:57:29.330856Z","iopub.status.busy":"2023-02-02T05:57:29.328746Z","iopub.status.idle":"2023-02-02T05:58:02.103654Z","shell.execute_reply":"2023-02-02T05:58:02.100375Z"},"papermill":{"duration":32.785227,"end_time":"2023-02-02T05:58:02.107019","exception":false,"start_time":"2023-02-02T05:57:29.321792","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["install.packages(\"janeaustenr\")\n","install.packages(\"tidytext\")"]},{"cell_type":"markdown","id":"cfd0226b","metadata":{"papermill":{"duration":0.005265,"end_time":"2023-02-02T05:58:02.118872","exception":false,"start_time":"2023-02-02T05:58:02.113607","status":"completed"},"tags":[]},"source":["# Import Libraries"]},{"cell_type":"code","execution_count":2,"id":"1cbb06ed","metadata":{"execution":{"iopub.execute_input":"2023-02-02T05:58:02.178455Z","iopub.status.busy":"2023-02-02T05:58:02.131783Z","iopub.st