nce/article/abs/pii/S095741741830143X)"]},{"cell_type":"markdown","id":"6bf20efd","metadata":{"papermill":{"duration":0.005742,"end_time":"2023-02-02T05:58:03.475634","exception":false,"start_time":"2023-02-02T05:58:03.469892","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"5fa7cc53","metadata":{"papermill":{"duration":0.005603,"end_time":"2023-02-02T05:58:03.486873","exception":false,"start_time":"2023-02-02T05:58:03.48127","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"b96c2663","metadata":{"execution":{"iopub.execute_input":"2023-02-02T05:58:03.501772Z","iopub.status.busy":"2023-02-02T05:58:03.500095Z","iopub.status.idle":"2023-02-02T05:58:03.548441Z","shell.execute_reply":"2023-02-02T05:58:03.546752Z"},"papermill":{"duration":0.058008,"end_time":"2023-02-02T05:58:03.550752","exception":false,"start_time":"2023-02-02T05:58:03.492744","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>